import { useState } from "react";
import  logo from "../media/logo.png" ;
import { Link } from "react-router-dom";
import navlinksList from "../utils/navlinksList";



export default function Navbar() {

  const  [active, setactive] = useState(false);

  const handleActive=()=>{
    setactive(!active);
  }

 
  return (
    <div className="navbar" >
      <Link onClick={handleActive} style={{textDecoration:"none"}} to="/"><div className="navbar__logo"><img src={logo} alt="logo" /></div></Link>
        

        <ul className={active ? "navbar__links active" : "navbar__links"}>
       
          <Link onClick={handleActive} style={{textDecoration:"none"}} to="about"><li>about me</li> </Link>
    
    
          <Link onClick={handleActive} style={{textDecoration:"none"}} to="mail"><li>mail me</li> </Link>
     
      
          <Link onClick={handleActive}  style={{textDecoration:"none"}} to="resume"><li>resume</li> </Link>
      
        </ul>   

        <div className={active ? "navbar__ham active" : "navbar__ham"}  onClick={handleActive}>
            <div></div>
            <div></div>
            <div></div>
        </div>
    </div>
  )
}
